import CheckIcon from "@mui/icons-material/Check";
import ModeEditOutlineOutlinedIcon from "@mui/icons-material/ModeEditOutlineOutlined";
import DeleteOutlineIcon from "@mui/icons-material/DeleteOutline";
import IconButton from "@mui/material/IconButton";
import "./icon.css";

export default function Icons({ handleCheckClick }) {
  function handleCheckClick() {
    handleCheckClick();
  }
  return (
    <div
      style={{
        display: "flex",
        direction: "rtl",

        justifyContent: "space-around",
        alignItems: "center",
        fontSize: "6px",
      }}
    >
      <IconButton aria-label="delete">
        <CheckIcon
          className="myIcon"
          style={{
            color: "#8bc34a",
            padding: "3px",
            background: "white",
            border: "1px solid #8bc34a",
            borderRadius: "50%",
            fontSize: "20px",
            transition: ".3s",
          }}
          onClick={() => {
            handleCheckClick();
          }}
        />
      </IconButton>
      <IconButton aria-label="delete">
        <ModeEditOutlineOutlinedIcon
          className="myIcon"
          style={{
            color: "#1769aa",
            background: "white",
            border: "1px solid #1769aa",
            borderRadius: "50%",
            fontSize: "20px",
            transition: ".3s",
            padding: "3px",
          }}
        />
      </IconButton>
      <IconButton aria-label="delete">
        <DeleteOutlineIcon
          className="myIcon"
          style={{
            background: "white",
            border: "1px solid red",
            borderRadius: "50%",
            fontSize: "20px",
            transition: ".3s",
            padding: "3px",
          }}
          color="error"
        />
      </IconButton>
    </div>
  );
}
